        <div className="container mt-3">
            <ul className="list-group mb-4">
                {photoList.map(photo =>(
                    <li key={photo.id} className="list-group-item">
                        <img src={photo.url} className="img-fluid" alt="Responsive image" />
                    </li>
                ))}
            </ul>
